import React from 'react';
import CardPic from '../components/Design/CardPic'
import { Container } from 'react-bootstrap'
import Curveball from '../assets/images/Personal/Curveball.JPG'
import CodePic from '../assets/images/Backgrounds/PankajPatelVSC.jpeg'
import '../assets/css/home.css'
import portfolioData from '../assets/portfolioData.json'

const Portfolio = () => {

    return(
    <div className="wallpaper" style={{backgroundImage: `url(${CodePic})` }}>

        <Container style={styles.page}>
            <div>
            {portfolioData.map(item=>(
            <CardPic 
                key={item.id}
                style={styles.projectCard}
                image={require('../assets/images/Projects'+ item.image)}
                title={item.title}
                description={item.description}
            />
            ))}
            </div>
        </Container>  
    </div>
    )
}

const styles= {
    page: {
        paddingTop: '5em'
    },
    projectCard : {
        width: '20em', 
        height: '10em', 

    }
}

export default Portfolio;
